import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import Header from './component/Header'

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Route />
      </div>
    </BrowserRouter>
  );
}

export default App;
